import React, { useEffect, useState } from "react";
import ApiManager from "./api/ApiManager";

const App = () => {
	const api = new ApiManager();
	const [matches, setMatches] = useState({});

	const matchesApi = async () => {
		try {
			const responseMatches = await api.makeRequest("standings", "GET", {season: 2023, league: 39});
			setMatches(responseMatches);
			console.log(matches);
		} catch (error) {
			console.log(error);
		}
	};

	useEffect(() => {
		matchesApi();
	}, []);

	const leagueIcon = matches.response?.[0]?.league?.logo
	const leagueName = matches.response?.[0]?.league?.name


	return (
		<>
		<div className=" main p-4 flex items-center justify-center">
			<div className="text-white text-white flex flex-col p-4 w-full">
				<div className="flex w-full items-center justify-between">
					<div className="flex items-center gap-4">
						<img className="h-8" src="https://media.api-sports.io/football/leagues/39.png" alt="leagueIcon"/>
						<div className="text-xl font-bold">Premier League</div>
					</div>
					<div>
						<img className="h-6" src="https://media.api-sports.io/flags/gb.svg" alt="leagueFlag"/>
					</div>
				</div>
				<div className="mt-7 flex flex-col gap-2">
					<div className="bg-[#312e40] p-4 rounded-lg flex gap-4">
						<div className="flex gap-5 items-center basis-6/12">
							<div className="font-bold text-lg">1</div>
							<img className="h-8" src="https://media.api-sports.io/football/teams/50.png" alt="teamLogo"/>
							<div className="text-lg">Manchester City</div>
						</div>
						<div className="flex items-center justify-between basis-3/12">
							<div className="text-lg">14</div>
							<div className="text-lg">3</div>
							<div className="text-lg">1</div>
							<div className="text-lg">35</div>
						</div>
						<div className="flex items-center basis-3/12 justify-end gap-2">
							<div className="rounded-full bg-[#7efc4d] h-6 flex items-center justify-center">
								<div className="text-sm font-bold">W</div>
							</div>
							<div className="rounded-full bg-[#7efc4d] h-6 flex items-center justify-center">
								<div className="text-sm font-bold">W</div>
							</div>
							<div className="rounded-full bg-[#ea3323] h-6 flex items-center justify-center">
								<div className="text-sm font-bold">L</div>
							</div>
							<div className="rounded-full bg-[#f6e161] h-6 flex items-center justify-center">
								<div className="text-sm font-bold">T</div>
							</div>
							<div className="rounded-full bg-[#ea3323] h-6 flex items-center justify-center">
								<div className="text-sm font-bold">L</div>
							</div>
						</div>
					</div>
				</div>
			</div>
		</div>
		</>
	);
};

export default App;
